import logo from './logo.svg';
import background from './qg_forest.jpg';
import './App.css';
import React, { Component } from 'react';
import Icon from './Icon.js';
import Sprite from '../sprites/kenney_toon-characters-1/MaleAdventurer/PNG/PosesHD/character_maleAdventurer_behindBack.png'


function backgroundStyle() {
  return {
    backgroundImage: `${background}`,
    backgroundSize: 'cover',
    backgroundPosition: 'center',
    backgroundRepeat: 'no-repeat',
    height: '100vh',
    width: '100vw',
    position: 'absolute',
    top: '0',
    left: '0',
    zIndex: '-1',
  }
}
function App() {
  return (
    <>
      <div className="App">
        <header className="App-header">
          <p>
            Quest Gang, see us in the forest you better run.
          </p>
          <Icon name = "Rogue"/>
          <Icon name = "Wizard"/>
          <Icon name = "Cleric"/>
          <a
            className="App-link"
            href="https://reactjs.org"
            target="_blank"
            rel="noopener noreferrer"
          >
            Learn React
          </a>
        </header>
      </div>
    </>
  );
}

export default App;

